DROP DATABASE  IF EXISTS biblioteca;

CREATE DATABASE biblioteca;

USE biblioteca;

CREATE TABLE categoria(
	cat_id INT PRIMARY KEY AUTO_INCREMENT,
	cat_nome VARCHAR(255) NOT NULL,
	main_cat_id INT
);

CREATE TABLE libro(
	idl INT PRIMARY KEY AUTO_INCREMENT,
	isbn CHAR(17) NOT NULL UNIQUE,
	titolo VARCHAR(255) NOT NULL,
	data_pub DATE NOT NULL,
	editore VARCHAR(255) NOT NULL,
	cat_id INT NOT NULL,
	FOREIGN KEY (cat_id) REFERENCES categoria(cat_id)
);

CREATE TABLE autore (
	ida INT PRIMARY KEY AUTO_INCREMENT,
	nome VARCHAR(255) NOT NULL,
	cognome VARCHAR(255) NOT NULL
);

CREATE TABLE scrive(
	idl INT NOT NULL,
	ida INT NOT NULL,
	FOREIGN KEY (ida) REFERENCES autore(ida) ON UPDATE CASCADE ON DELETE RESTRICT,
	FOREIGN KEY (idl) REFERENCES libro(idl) ON UPDATE CASCADE ON DELETE RESTRICT
);
   

CREATE TABLE copia (
	idc INT PRIMARY KEY AUTO_INCREMENT,
	idl INT NOT NULL,
	edizione INT NOT NULL,
	FOREIGN KEY (idl) REFERENCES libro(idl) ON UPDATE CASCADE ON DELETE RESTRICT
);
   
CREATE TABLE utente(
	num_tessera INT PRIMARY KEY AUTO_INCREMENT,
	cf CHAR(16) NOT NULL UNIQUE,
	nome VARCHAR(255) NOT NULL,
	cognome VARCHAR(255) NOT NULL,
	telefono VARCHAR(20) NOT NULL,
	datan DATE NOT NULL
);

CREATE TABLE prestito (
	idp INT PRIMARY KEY AUTO_INCREMENT,
	data_prestito DATE NOT NULL,
	data_restituzione DATE,
	num_tessera INT NOT NULL,
	idc INT NOT NULL,
	FOREIGN KEY (num_tessera) REFERENCES utente(num_tessera) ON UPDATE CASCADE ON DELETE RESTRICT,
	FOREIGN KEY (idc) REFERENCES copia(idc) ON UPDATE CASCADE ON DELETE RESTRICT
);



ALTER TABLE categoria ADD CONSTRAINT FOREIGN KEY (main_cat_id) REFERENCES categoria(cat_id);







































































